<div class="card-container">
  <div class="card center-align col s8 m3 push-s2 push-m0 effect" (window:resize)="onResize($event)">
    <div>
      <img class="fii-img" id="fii-img" src="../../../../assets/img/logo_complet.png">
      <!--<h1 class="login-title"> Log In</h1>-->
    </div>
    <form method="post" #loginForm="ngForm">
      <div class="row">

        <div *ngIf="error" class="error-message">
          <p class="mat-error">*Email or password is invalid!</p>
        </div>

        <div class="input-field col s12">
          <input type="email" name="email" [(ngModel)]="model.email" #email="ngModel">
          <label>Email</label>
        </div>

        <div class="input-field col s12">
          <input type="password" name="password" [(ngModel)]="model.password" #password="ngModel">
          <label>Password</label>

        </div>

      </div>

      <div class="login-footer row">

        <button class="btn waves-effect waves-light" type="submit" name="action" (click)="onSubmit(loginForm.value)">Log
          In
        </button>
        <br>
        <a routerLink="/forgot-password"><h6>Reset password</h6></a> or <a routerLink="/register"><h6>Create an
        account</h6></a>
      </div>

    </form>
  </div>
</div>
